import React from "react";
import Table from "./Table";

class Employee extends React.Component {
  render() {
    return (
      <ul>
        {this.props.employees.map((employee) => (
          <li key={employee.id}>{employee.name}</li>
        ))}
      </ul>
    );
  }
}

export default Employee;
